export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Find tutorials, examples and technical articles that will help you to develop with Redis and Python.`}</p>
    <h3 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h3>
    <p>{`The Python community has built many client libraries that you can find `}<a parentName="p" {...{
        "href": "https://redis.io/clients#python"
      }}>{`here`}</a>{`.
For your first steps with Python and Redis, this article will show how to use the recommended library: `}<a parentName="p" {...{
        "href": "https://github.com/andymccurdy/redis-py"
      }}>{`redis-py`}</a>{`.`}</p>
    <Tabs defaultValue="redis-py" values={[{
      label: 'Redis Py',
      value: 'redis-py'
    }]} mdxType="Tabs">
  <TabItem value="redis-py" mdxType="TabItem">
        <h3 {...{
          "id": "step-1-install-the-redis-library-using-pip"
        }}>{`Step 1. Install the Redis library using `}<inlineCode parentName="h3">{`pip`}</inlineCode></h3>
        <pre><code parentName="pre" {...{
            "className": "language-bash"
          }}>{` pip3 install redis
`}</code></pre>
        <h3 {...{
          "id": "step-2-write-your-application-code"
        }}>{`Step 2. Write your application code`}</h3>
        <pre><code parentName="pre" {...{
            "className": "language-python"
          }}>{` import redis

 redis = redis.Redis(
     host= 'localhost',
     port= '6379')

 redis.set('mykey', 'Hello from Python!')
 value = redis.get('mykey') 
 print(value)

 redis.zadd('vehicles', {'car' : 0})
 redis.zadd('vehicles', {'bike' : 0})
 vehicles = redis.zrange('vehicles', 0, -1)
 print(vehicles)
`}</code></pre>
        <p>{`Find more information about Redis & Redis connections in the "`}<a parentName="p" {...{
            "href": "https://github.com/redis-developer/redis-connect/tree/master/python/redispy"
          }}>{`Redis Connect`}</a>{`".`}</p>
 </TabItem>
    </Tabs>

    <h3 {...{
      "id": "more-developer-resources"
    }}>{`More developer resources`}</h3>
    <div class="row">
      <div class="col">
        <h4 {...{
          "id": "sample-code"
        }}>{`Sample Code`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://github.com/redis-developer/basic-caching-demo-nodejs"
            }}>{`Flask Simple Rate limiting Example   `}</a></strong>{`
Application that shows how to do rate limiting using various Redis datastructure.`}</p>
      </div>
      <div class="col">
        <h4 {...{
          "id": "technical-articles--videos"
        }}>{`Technical Articles & Videos`}</h4>
        <p><strong parentName="p"><a parentName="strong" {...{
              "href": "https://redislabs.com/blog/beyond-the-cache-with-python/"
            }}>{`Beyond the Cache with Python`}</a></strong></p>
      </div>
    </div>
    <hr></hr>
    <h3 {...{
      "id": "redis-launchpad"
    }}>{`Redis Launchpad`}</h3>
    <p>{`Redis Launchpad is like an “App Store” for Redis sample apps. You can easily find apps for your preferred frameworks and languages.
Below are few of these apps. `}<a parentName="p" {...{
        "href": "https://launchpad.redis.com"
      }}>{`Click here to access the complete lists of apps`}</a></p>
    <div class="row text--center">
      <div class="col ">
        <div className="ri-container">
          <h4 {...{
            "id": "rate-limiting-app-in-python--django"
          }}>{`Rate-Limiting app in Python & Django`}</h4>
          <p><img alt={"launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/ratelimitingdjango.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-rate-limiting-demo-python"
            }}>{`Rate Limiting app`}</a>{` built in Python & Django`}</p>
        </div>
      </div>
      <div class="col">
        <div className="ri-container">
          <h4 {...{
            "id": "leaderboard-app-in-python--django"
          }}>{`Leaderboard app in Python & Django`}</h4>
          <p><img alt={"launchpad"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/leaderboarddjango.png").default} /></p>
          <p><a parentName="p" {...{
              "href": "https://launchpad.redis.com/?id=project%3Abasic-redis-leaderboard-demo-python"
            }}>{`How to implement leaderboard app`}</a>{` in Python & Django`}</p>
        </div>
      </div>
    </div>
    <h3 {...{
      "id": "redis-university"
    }}>{`Redis University`}</h3>
    <h3 {...{
      "id": "redis-for-python-developers"
    }}><a parentName="h3" {...{
        "href": "https://university.redislabs.com/courses/ru102py/"
      }}>{`Redis for Python Developers`}</a></h3>
    <p>{`A complete introduction to Redis for Python developers.`}</p>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/BxRJRNt7Qwc" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.redislabs.com/howtos/redisjson/storing-json-document#redisjson-python-client"
        }}>{`Storing JSON document in Redis using Python`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.redislabs.com/howtos/herokupython/"
        }}>{`Python based application on Heroku using Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.redislabs.com/howtos/ratelimiting/"
        }}>{`How to build a Rate Limiter using Redis`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://developer.redislabs.com/explore/redisinsight/redisgears/"
        }}>{`Writing Your Serverless function using RedisGears Browser Tool`}</a></li>
    </ul>
    </MDXLayout>;
}

